INSERT INTO `question_submit` VALUES (1698297872854093825, 'java', 'public class Main {\rpublic static void main(String[] args) {\r  int a=Integer.parseInt(args[0]);\r  int b=Integer.parseInt(args[1]);\r  }\r}', '{\"message\":\"答案错误\",\"memory\":139264,\"time\":122}', 3, 1697645286983524353, 1691401540448927746, '2023-09-03 19:32:20', '2023-09-03 19:32:34', 0);
INSERT INTO `question_submit` VALUES (1698307336914890754, 'java', 'public class Main {\r\npublic static void main(String[] args) {\r\n  int a=Integer.parseInt(args[0]);\r\n  int b=Integer.parseInt(args[1]);\r\n  int count = 0;//记录9的个数\r\n  for (int i = a; i <= b ; i++) {\r\n            if (i % 10 == 9) {\r\n                //看个位是不是9\r\n                count++;\r\n            }else if (i / 10 == 9) {\r\n                //看十位是不是9\r\n                count++;\r\n            }\r\n        }\r\n        System.out.println(count);\r\n  }\r\n}', '{\"message\":\"成功\",\"memory\":135168,\"time\":120}', 2, 1697645286983524353, 1698307135370194945, '2023-09-03 20:09:56', '2023-09-03 20:10:10', 0);
